import React from 'react';
import './MidPanel.css';

class MidPanel extends React.Component{

	render(){
	return(
		<div className="MidPanel">
          <p>{this.props.selectedCat.name}</p>
          <p>Number of times clicked :{this.props.selectedCat.counter}</p>
          <img className="CatImage" src={this.props.selectedCat.url}/>
        </div>
		);
}

}


export default MidPanel;
